import React from 'react';

import { Container, InputContainer, Title, InputMaskCustom } from './styled';

interface Props {
  title: string;
  mask: string;
  placeholder?: string | undefined;
  width?: number;
}

const InputMask: React.FC<Props> = ({ title, mask, placeholder, width }) => {
  return (
    <Container width={width}>
      <Title>{title}</Title>
      <InputContainer>
        <InputMaskCustom
          mask={mask}
          maskPlaceholder=""
          placeholder={placeholder}
        />
      </InputContainer>
    </Container>
  );
};

export default InputMask;
